    def ep2_toll_begin_combat_qf():
        sparkler = pwenemies.Sparkler(person.MALE)
        thumper1 = pwenemies.Thumper(person.MALE)
        thumper2 = pwenemies.Thumper(person.FEMALE)
        crackler = pwenemies.Crackler(person.FEMALE)
        enemies = [sparkler, thumper1, thumper2, crackler]
        def end_combat(defeatedAllies, defeatedEnemies, victorious):
            universal.state.defeatedAllies = defeatedAllies
            universal.state.defeatedEnemies = defeatedEnemies
            if victorious:
                pwutilities.maze.litany = conversation.allNodeNames["ep2 toll end combat victory"]
            else:
                pwutilities.maze.litany = conversation.allNodeNames["ep2 toll end combat defeat"]
            conversation.converse_with(pwutilities.maze)
        fightArgs = [enemies, end_combat, dungeonmode.dungeon_mode, False, False, True,             None, 0, False, None]
        return (universal.acknowledge, [combat.fight] + fightArgs)
        ep2_toll_begin_combat.quip = " "
        universal.say(universal.format_text_translate([[], [], [], []]), justification=0)
